def find_original_set(*args):
    if len(args) != 78:
        raise ValueError("Exactly 78 arguments expected")

    original_set = set()

    for arg in args:
        original_set.update(arg)

    return original_set
```
This Python function `find_original_set` accepts variable number of arguments (*args) which are supposed to be 78 sets of integers. The function updates a new set (`original_set`) with each set of integers provided as argument. In the end, the function returns `original_set` which is a set containing all unique integers from all 78 sets. The method `update()` is used for adding multiple items to the set. If an integer already exists in the set, `update()` doesn't add it again, thus ensuring that the 'original_set' remains a set.
